"120582":{"id":"120582","name":"O Maior Roubo de Arte de Todos os Tempos","slug":"o-maior-roubo-de-arte-de-todos-os-tempos","original_title":"This Is a Robbery: The World's Biggest Art Heist","overview":"Foi o maior roubo de arte da história: no Dia de São Patrício em 1990, obras lendárias de Rembrandt, Vermeer e outros, que hoje valeriam mais de meio bilhão de dólares, foram roubadas do Museu Isabella Stewart Gardner em Boston. Com direção de Colin Barnicle, esta série documental em quatro partes conta como foi a investigação desse mistério, que até hoje não foi resolvido.","first_air_date":"2021-04-07","episode_run_time":52,"vote_average":6.8,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["Barnicle Brothers"],"genres":["Documentário","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/dgwKC13bWaPrR3hX1klsftVZTa0.jpg","poster_path":"https://image.tmdb.org/t/p/original/ncDBeRjalCMwmPs9yBv4KfNZrEo.jpg","cast":["Shelley Murphy","Anne Hawley","Dick Ellis","Martin Leppo","Tron Brekke"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/oB42FcH34UwO0eY0Q9QVIVRN1pN.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/oB42FcH34UwO0eY0Q9QVIVRN1pN.jpg","air_date":"2021-04-07","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Eles pareciam policiais","overview":"O guarda do museu deixa entrar dois homens vestidos de policiais, que desaparecem 81 minutos depois com um valiosíssimo Rembrandt e inúmeras outras obras de arte.","air_date":"2021-04-07","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/bqAUyJvG8stWPrxauoxSHgenL9p.jpg","vote_average":0},"2":{"name":"Muitos interessados","overview":"Será que alguém de dentro do museu havia facilitado o roubo? A polícia identifica um suspeito, mas uma série de erros dificulta a investigação.","air_date":"2021-04-07","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/bH8wtNhf31AzW900YpnGL8UdCdM.jpg","vote_average":0},"3":{"name":"Nós vimos","overview":"Em meio a inúmeras especulações sobre o roubo, atividades ligadas ao crime organizado levam aos possíveis culpados e revelam uma motivação para o crime.","air_date":"2021-04-07","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/lr2bEVxexoINJKMviwgWCvUUeRI.jpg","vote_average":0},"4":{"name":"Recompensa de US$ 10 milhões","overview":"Os agentes federais seguem uma nova pista revelada por um informante, e uma operação policial os leva até a casa de um criminoso sem muitos poderes.","air_date":"2021-04-07","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/50hHyUG9aDGRXOsgSLRX878J6Ll.jpg","vote_average":0}}}}},
